import React, { useState, useEffect } from 'react';
import { TextField } from '@material-ui/core';
import { Link } from "react-router-dom";
import { Button } from '@material-ui/core';
import Snackbar from '@material-ui/core/Snackbar';
import MuiAlert from '@material-ui/lab/Alert';
import axios from 'axios';
import Baskets from "./Baskets";
import { useLocation } from "react-router-dom";



const Title1 = {
  fontSize: '20px',
  color: '#008037',
  fontWeight: 'bold',
  marginLeft: '20px',
  justifyContent: 'center'
}
const Field = {
  marginLeft: '20px',
  width: '500px',
  marginTop: '25px',
  padding: '15px',


}
const buttonstyle = {
  marginLeft: '150px',
  marginTop: '50px',
  backgroundColor: '#008037',
  width: '80px',
  borderRadius: '5px'



}

const Basketsadd = () => {

  function Alert(props) {
    return <MuiAlert elevation={6} variant="filled" {...props} />;
  }

  const [data, setData] = React.useState({
    error: '',
    data: [],
    temp: [],
    error: null,
    items: []

  });
  const location = useLocation();
  const [basketdata, setBasketdata] = React.useState({
    nom: "",
    partner_id: "",
    createdAt: "",
    updatedAt: ""
    // nom: "",
    // PriceBeforeDiscount: "",
    // PriceAfterDiscoun: "",
    // Discount: "",
    // Description:"",
    // restaurant_id:""
  });

  const namechange = (e) => {
    setBasketdata({
      ...basketdata,
      nom: e
    })
  }
  const partneridchange = (e) => {
    setBasketdata({
      ...basketdata,
      partner_id: e
    })
  }
  const createchange = (e) => {
    setBasketdata({
      ...basketdata,
      createdAt: e
    })
  }
  const updatechange = (e) => {
    setBasketdata({
      ...basketdata,
      updatedAt: e
    })
  }
  // const namechange = (e) => {
  //   setBasketdata({
  //     ...basketdata,
  //     nom: e
  //   })
  // }
  // const beforedischange = (e) => {
  //   setBasketdata({
  //     ...basketdata,
  //     PriceBeforeDiscount: e
  //   })
  // }
  // const afterdischange = (e) => {
  //   setBasketdata({
  //     ...basketdata,
  //     PriceAfterDiscoun: e
  //   })
  // }
  // const discountchange = (e) => {
  //   setBasketdata({
  //     ...basketdata,
  //     Discount: e
  //   })
  // }
  // const descriptionchange = (e) => {
  //   setBasketdata({
  //     ...basketdata,
  //     Description: e
  //   })
  // }
  // const restidchange = (e) => {
  //   setBasketdata({
  //     ...basketdata,
  //     restaurant_id: e
  //   })
  // }
  const [open, setOpen] = React.useState(false);

  const handleClick = () => {
    setOpen(true);
  };

  const onClick = () => {
    handleClick();
    addBasket();
  };

  const handleClose = (event, reason) => {
    if (reason === 'clickaway') {
      return;
    }

    setOpen(false);
  };
  const addBasket = () => {
    axios.post('http://192.168.22.205:5000/api/entreroffres/register', {

      nom: basketdata.nom,
      partner_id: basketdata.partner_id,
      createdAt: basketdata.createdAt,
      updatedAt: basketdata.updatedAt,
      // nom: basketdata.nom,
      // PriceBeforeDiscount: basketdata.PriceBeforeDiscount,
      // PriceAfterDiscoun: basketdata.PriceAfterDiscoun,
      // discount: basketdata.Discount,
      // description: basketdata.Description,
      // restaurant_id: basketdata.restaurant_id
    }

    ).then(() => {
      console.log("done");


    })
      .catch(error => {
        console.log(error)
      });
  }





  return (
    <div >
      <div style={Title1}>
        <h2> Enter new Basket</h2>
      </div>
      <div style={Field}>
        <TextField
          label="nom" onChange={e => namechange(e.target.value)} />
        <TextField
          label="partner_id" onChange={e => partneridchange(e.target.value)} />
        <TextField
          label="createdAt" onChange={e => createchange(e.target.value)} />
        <TextField
          label="UpdatedAt" onChange={e => updatechange(e.target.value)} />
      </div>
      {/* <div style={Field}>
      <TextField
        label="nom"  onChange={e=>namechange(e.target.value)} />

      <TextField style={{ marginLeft: '50px' }}
        label="origin price"  onChange={e=>beforedischange(e.target.value)} />

    </div >

    <div style={Field}>
      <TextField
       label="price after reduction"  onChange={e=>afterdischange(e.target.value) } />
    </div>
    <div style={Field}>
      <TextField
         label="discount"  onChange={e=>discountchange(e.target.value) }  />

      <TextField style={{ marginLeft: '50px' }}
         label="description"  onChange={e=>descriptionchange(e.target.value) } />

      <TextField style={{ marginLeft: '50px' }}
         label="restaurant_id"  onChange={e=>restidchange(e.target.value) } />
    </div> */}



      <div style={buttonstyle}>
        <Link to= './pages/Baskets/Baskets'>
        <Button variant="outline-success" onClick={() => onClick()} >Valider</Button>
       
        </Link>
        <Snackbar open={open} autoHideDuration={6000} onClose={handleClose}>
          <Alert onClose={handleClose} severity="success">
            basket is successfully added!
        </Alert>
        </Snackbar>
      </div>

    </div>

  )

};

export default Basketsadd;
